// src/pages/Tutor/NovoTutor.jsx
import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';

const NovoTutor = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '',
    telefone: '',
    email: '',
    cpf: '',
    endereco: '',
    dataNascimento: '',
    senha: '',  // adicionado
    ativo: true,
    observacoes: ''
  });
  const [errors, setErrors] = useState({});

  const validate = () => {
    const cpfNumerico = form.cpf.replace(/\D/g, '');
    const telNumerico = form.telefone.replace(/\D/g, '');
    const newErrors = {};

    if (!form.nome.trim()) newErrors.nome = 'Nome é obrigatório';
    else if (!/^[A-Za-zÀ-ú\s]+$/.test(form.nome)) newErrors.nome = 'Use apenas letras no nome';

    if (!telNumerico || telNumerico.length < 10 || telNumerico.length > 11)
      newErrors.telefone = 'Telefone inválido';

    if (!form.email.trim() || !form.email.includes('@'))
      newErrors.email = 'Email inválido';

    // validação de senha
    if (!form.senha || form.senha.length < 6)
      newErrors.senha = 'Senha deve ter ao menos 6 caracteres';

    if (!cpfNumerico || cpfNumerico.length !== 11)
      newErrors.cpf = 'CPF deve ter 11 dígitos';

    if (!form.endereco.trim()) newErrors.endereco = 'Endereço é obrigatório';
    if (!form.dataNascimento) newErrors.dataNascimento = 'Data de nascimento obrigatória';

    return newErrors;
  };

  const handleChange = ({ target: { name, value } }) => {
    setForm((f) => ({ ...f, [name]: value }));
    setErrors((err) => ({ ...err, [name]: null }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const valids = validate();
    setErrors(valids);

    if (Object.keys(valids).length === 0) {
      try {
        await api.post('/tutores', form);
        navigate('/tutores');
      } catch (err) {
        const resp = err.response?.data;
        if (resp?.erros) {
          const fieldErrors = resp.erros.reduce(
            (acc, cur) => ({ ...acc, [cur.path]: cur.msg }),
            {}
          );
          setErrors(fieldErrors);
        } else {
          setErrors({ form: resp?.erro || 'Erro ao cadastrar tutor' });
        }
      }
    }
  };

  return (
    <div className="container mt-4">
      <h2>Cadastrar Tutor</h2>
      <form onSubmit={handleSubmit} noValidate>
        {/* Demais campos (nome, telefone, email, cpf) */}
        <div className="mb-3">
          <label className="form-label">Email:</label>
          <input
            type="email"
            name="email"
            className={`form-control ${errors.email ? 'is-invalid' : ''}`}
            value={form.email}
            onChange={handleChange}
            required
          />
          {errors.email && <div className="invalid-feedback">{errors.email}</div>}
        </div>

        {/* Campo de senha adicionado */}
        <div className="mb-3">
          <label className="form-label">Senha:</label>
          <input
            type="password"
            name="senha"
            className={`form-control ${errors.senha ? 'is-invalid' : ''}`}
            value={form.senha}
            onChange={handleChange}
            minLength={6}
            required
          />
          {errors.senha && <div className="invalid-feedback">{errors.senha}</div>}
        </div>

        {/* Demais campos (endereco, dataNascimento, observacoes, ativo) */}
        <div className="mb-3">
          <label className="form-label">Observações:</label>
          <textarea name="observacoes" className="form-control" rows={3} value={form.observacoes} onChange={handleChange} />
        </div>

        <button type="submit" className="btn btn-success">Cadastrar Tutor</button>
      </form>
    </div>
  );
};

export default NovoTutor;
